import React, {Fragment} from 'react'

const Note = ({ note, toggleImportance }) => {

  const label = toggleImportance ? "make not important" : "make important"

  return (
    <Fragment>
      <li>{note.content}</li>
      <button>{label}</button>
    </Fragment>
  )
}

export default Note
